          className="m-auto"
        />

        <Link to="/">
          {" "}
          <Button
            className=" m-auto mb-5"
            style={{ width: "150px", fontSize: "20px" }}
          >
            {" "}
            Back to Home{" "}
          </Button>
        </Link>
      </div>
    </>
  );
};

export default PageNotFound;
